import React, { useState, useEffect } from "react";
import classNames from "../utils/class-names/index";

function Home() {
  return (
    <div className="container">
      <button size="lg" className="btn btn-secondary">
        <span className="oi oi-plus" /> <span></span>
        Create Deck
      </button>
      <div>
       <div className="row">
           <div className="col-4">
           <h4>React Deck Name</h4>
           </div>
           <div className="col-4">
           <p>Number of cards</p>
           </div>

       </div>
       </div>
    </div>
  );
}

export default Home;
